import React, { Component } from 'react'

export class App extends Component {
  constructor(props) {
    super(props)

    this.state = {
      selectedTrack: null
    }
  }

  render() {
    const list = [
      {
        id: 1,
        title: "Campfire story"
      },
      {
        id: 2,
        title: "Booting up"
      }
    ]
    return (
      <>
        <h1>My little player</h1>
        <ul>list</ul>
      </>
    )
  }
}

export default App
